import React from 'react'
import styled from 'styled-components';

const Styles = styled.div`
	.nav {
		background-color: black;
		color: white;
		width: 15%;
		height: 100%;
		position: fixed;
		top: 0;
		left: 0;
	}
`;

export default class NavigationBar extends React.Component {
	render() {
		return(
			<Styles>
			<div className='nav'>
				<button>collapse/expand nav</button>
				<ul>
					<li>My Account</li>
					<li>My Characters</li>
					<li>About MTTH</li>
					<li>Contact</li>
				</ul>
			</div>
			</Styles>
		)
	}
}
